import React from 'react';
import TodoList from "./components/TodoList";
import NewTodo from './components/NewTodo';

const App: React.FunctionComponent = () => {
	const todos = [{ id: "1", text: "todo1" }];


	return (
		<div className="App" >
			<NewTodo></NewTodo>
			<TodoList items={todos} />
		</div>
	);
}

export default App;
